import React from 'react';
import { Layout } from '../componets/Layout';
import '../index.css'
import logo_siz from '../img/logo_siz.png'

export const HomePage = () => {
  return (
    <Layout>
      <div className="inicio">
        <img className='logoEA' src={logo_siz} alt="Eiliana" />
        <p>¡Hola! Soy Eiliana developer junior front-end y Periodista.
        Estudié Comunicación Social en Venezuela, ahora he transferido con éxito mi pasión por comunicarme a los lenguajes de programación, actualmente estoy en una bootcamp aprendiendo más sobre HTML, CSS, JavaScript, Github, React, Node.JS.
        En este momento, mi principal objetivo profesional es encontrar empleo que me permita compatibilizar mi experiencia como periodista y al mismo tiempo profundizar y mejorar mis habilidades de programación.
        Tengo facilidad para comunicarme y me adapto muy rápidamente al trabajo en equipo, me gusta aprender, he desarrollado mis habilidades de autoaprendizaje. Soy una mujer responsable, amable y divertida. Me encanta viajar, hacer ejercicios, bailar.</p>
      </div>
    </Layout>
  )
}
